    public static int algo1(int[] array){
        int inversionCount = 0;
        for(int i = 0; i<array.length; i++){
            int c1 = array[i];
            for(int j= i; j< array.length;j++){
                int c2 = array[j];
                if(c1 > c2)
                    inversionCount++;
            }

        }
        return inversionCount;
    }


