    public static int[] randomArray(int size){
        int[] array = new int[size];
        int i = 0;
        while (i < size){
            int a = (int)(Math.random() * ( size - 0 ));
            array[i] = a;
            i++;
        }
        return array;
    }

    public static ArrayList<ArrayList<Integer>> divideArray(ArrayList<Integer> arrayList){
        ArrayList<ArrayList<Integer>> out = new ArrayList<ArrayList<Integer>>();
        ArrayList<Integer> a = new ArrayList<Integer>();
        ArrayList<Integer> b = new ArrayList<Integer>();
        int i = 0;
        for (;i < arrayList.size()/2; i++){
            a.add(arrayList.get(i));
        }
        for (;i < arrayList.size(); i++)
            b.add(arrayList.get(i));
        out.add(a);
        out.add(b);
        return out;

    }


    public static int countInversions1(int nums[]){
        int mid = nums.length/2, k;
        int countLeft, countRight, countMerge;
        if (nums.length <= 1)
            return 0;

        int left[] = new int[mid];
        int right[] = new int[nums.length - mid];

        for (k = 0; k < mid; k++)
            left[k] = nums[k];
        for (k = 0; k < nums.length - mid; k++)
            right[k] = nums[mid+k];
        countLeft = countInversions (left);
        countRight = countInversions (right);
        int result[] = new int[nums.length];
        countMerge = mergeAndCount1 (left, right, result);
        for (k = 0; k < nums.length; k++)
            nums[k] = result[k];
        return (countLeft + countRight + countMerge);

    }

    public static int countInversions(int nums[]){
        int mid = nums.length/2, k;
        int countLeft, countRight, countMerge;
        if (nums.length <= 1)
            return 0;

        int left[] = new int[mid];
        int right[] = new int[nums.length - mid];

        for (k = 0; k < mid; k++)
            left[k] = nums[k];
        for (k = 0; k < nums.length - mid; k++)
            right[k] = nums[mid+k];
        countLeft = countInversions (left);
        countRight = countInversions (right);
        int result[] = new int[nums.length];
        countMerge = mergeAndCount (left, right, result);
        for (k = 0; k < nums.length; k++)
            nums[k] = result[k];
        return (countLeft + countRight + countMerge);

    }

    public static int mergeAndCount (int left[], int right[], int result[]){
        int a = 0, b = 0, count = 0, i, k=0;
        while ( ( a < left.length) && (b < right.length) ){
            if ( left[a] <= right[b] )
                result [k] = left[a++];
            else{
                result [k] = right[b++];
                count += left.length - a;
            }
            k++;
        }
        if ( a == left.length )
            for ( i = b; i < right.length; i++)
                result [k++] = right[i];
        else
            for ( i = a; i < left.length; i++)
                result [k++] = left[i];

        return count;
    }

    public static int mergeAndCount1 (int left[], int right[], int result[]){
        int count = 0;
        for(int i = 0; i < left.length; i++){
            for(int  j = 0; j < right.length; j++){
                if(left[i] > right[j])
                    count++;
            }
        }
        return count;
    }

